(window.webpackJsonp=window.webpackJsonp||[]).push([[95],{637:function(e){e.exports=JSON.parse('{"name":"select","displayName":"Select *选择框*","group":"form","text":"\\n下拉选择框。\\n\\n``` demo.b358eb03\\nimport { Select } from \'nami\'\\n\\nrender(\\n    <Select>\\n        <Select.Option value=\\"js\\">JavaScript</Select.Option>\\n        <Select.Option value=\\"ts\\">TypeScript</Select.Option>\\n        <Select.Option value=\\"cs\\">CoffeeScript</Select.Option>\\n        <Select.Option value=\\"ls\\">LiveScript</Select.Option>\\n        <Select.Option value=\\"as\\">ActionScript</Select.Option>\\n    </Select>\\n)\\n```\\n\\n## 状态\\n\\n通过 state 参数定义选择框状态：\\n\\n``` demo.7e5115a2\\nimport { Select } from \'nami\'\\n\\nconst options = (\\n    <React.Fragment>\\n        <Select.Option value=\\"js\\">JavaScript</Select.Option>\\n        <Select.Option value=\\"ts\\">TypeScript</Select.Option>\\n        <Select.Option value=\\"cs\\">CoffeeScript</Select.Option>\\n        <Select.Option value=\\"ls\\">LiveScript</Select.Option>\\n        <Select.Option value=\\"as\\">ActionScript</Select.Option>\\n    </React.Fragment>\\n)\\n\\nrender(\\n    <div>\\n        <Select state=\\"success\\">{options}</Select>\\n        <Select state=\\"warning\\">{options}</Select>\\n        <Select state=\\"danger\\">{options}</Select>\\n    </div>\\n)\\n```\\n\\n## 禁用\\n\\n通过 disabled 参数，可以禁用选择框：\\n\\n``` demo.42eb3d18\\nimport { Select } from \'nami\'\\n\\nrender(\\n    <Select disabled>\\n        <Select.Option value=\\"js\\">JavaScript</Select.Option>\\n        <Select.Option value=\\"ts\\">TypeScript</Select.Option>\\n        <Select.Option value=\\"cs\\">CoffeeScript</Select.Option>\\n        <Select.Option value=\\"ls\\">LiveScript</Select.Option>\\n        <Select.Option value=\\"as\\">ActionScript</Select.Option>\\n    </Select>\\n)\\n```\\n\\n或禁用某个选择：\\n\\n``` demo.7b65f70f\\nimport { Select } from \'nami\'\\n\\nrender(\\n    <Select>\\n        <Select.Option disabled value=\\"js\\">\\n            JavaScript\\n        </Select.Option>\\n        <Select.Option disabled value=\\"ts\\">\\n            TypeScript\\n        </Select.Option>\\n        <Select.Option value=\\"cs\\">CoffeeScript</Select.Option>\\n        <Select.Option value=\\"ls\\">LiveScript</Select.Option>\\n        <Select.Option value=\\"as\\">ActionScript</Select.Option>\\n    </Select>\\n)\\n```\\n\\n## 参数\\n\\n### Select\\n\\n| 参数           | 说明           | 类型                                                   | 默认值  |\\n| -------------- | -------------- | ------------------------------------------------------ | ------- |\\n| `value`        | 选中值         | `string` &#124; `number`                               |         |\\n| `defaultValue` | 默认选中值     | `string` &#124; `number`                               |         |\\n| `state`        | 状态           | `\'success\'` &#124; `\'warning\'` &#124; `\'danger\'`       |         |\\n| `disabled`     | 是否禁用       | `boolean`                                              | `false` |\\n| `onChange`     | 所选项更改事件 | `(event: SelectEvent, value: string | number) => void` |         |\\n| `children`     | 选项           | `Select.Option`                                        |         |\\n\\n### Select.Option\\n\\n| 参数       | 说明         | 类型                     | 默认值  |\\n| ---------- | ------------ | ------------------------ | ------- |\\n| `value`    | 选项值       | `string` &#124; `number` |         |\\n| `children` | 选项显示内容 | `React.ReactNode`        |         |\\n| `disabled` | 是否禁用选项 | `boolean`                | `false` |\\n","path":"./src/components/select/index.md","demos":{"b358eb03":{"name":"default"},"7e5115a2":{"name":"state"},"42eb3d18":{"name":"disabled"},"7b65f70f":{"name":"disabled-option"}}}')}}]);